import {Card} from 'antd';

const SkillCard=({setSkill})=>{

    return(
        <Card className="skilld">
            <Card.Meta title={setSkill.skillTitle}
                       description={setSkill.skillAbility}
                       avatar={<Avatar src={setSkill.skillImage}/>}
            />
        </Card>
    )
}
export default SkillCard;
